function getHardwareItemDeviceName(identifier) {
  switch (identifier) {
    case 'ControlHubAsREVModule':
      return 'Control Hub';
    case 'ControlHubAsServoController':
      return 'Control Hub';
    case 'ControlHubAsVoltageSensor':
      return 'Control Hub';
    case 'Webcam1AsWebcamName':
      return 'Webcam 1';
    case 'colorAsColorSensor':
      return 'color';
    case 'colorAsDistanceSensor':
      return 'color';
    case 'colorAsLightSensor':
      return 'color';
    case 'colorAsOpticalDistanceSensor':
      return 'color';
    case 'colorAsREVColorRangeSensor':
      return 'color';
    case 'imuAsBNO055IMU':
      return 'imu';
    case 'leftMotorAsDcMotor':
      return 'leftMotor';
    case 'rightMotorAsDcMotor':
      return 'rightMotor';
    case 'servo1AsServo':
      return 'servo1';
    case 'touchAsTouchSensor':
      return 'touch';
  }
  throw 'Unexpected identifier (' + identifier + ').';
}

